##*******************************************Subroutine for the conversion of files being used into hashes******************************
#***************************mass to lampid conversion*************************************************************************
sub mono2l
	{
	open FILE,"$HOME/data/all/mass/mono2l" or die "cannot open the file";
while (<FILE>)
	{
	chomp;
   	my ($key, $val) = split /!/;
  		$m2l{$key} .= exists $m2l{$key} ? "$val\n" : $val;
	}
	return %m2l;
	
};

#***************************mass to category conversion*************************************************************************
sub mono2cn
	{
	open FILE,"$HOME/data/all/mass/mono2cn" or die "cannot open the file";
while (<FILE>)
	{
	chomp;
   	my ($key, $val) = split /!/;
  	$m2cn{$key} .= exists $m2cn{$key} ? "$val\n" : $val;
	}};


#***************************mass to category conversion*************************************************************************
